`,GC="/Reubot-Studio/assets/news1-hWEcYmw4.jpg",VC="/Reubot-Studio/assets/news2-Dz_JqrF_.jpg",UC="/Reubot-Studio/assets/news3-BFJp5Xzm.png",HC="/Reubot-Studio/assets/news4-B0e1Ky_t.png",WC=[{id:1,title:"Lancement de notre nouveau jeu : Cyberpunk 2077 !",date:"1 Décembre 2024",img:GC,text:"Nous sommes ravis de vous annoncer la sortie de notre dernier projet, Cyberpunk 2077, prévue pour le 16 Mars 2025. Préparez-vous à plonger dans une aventure captivante au cœur de Night City, où des intrigues complexes et des choix moraux vous attendent à chaque coin de rue. Pour célébrer ce lancement, nous vous invitons à découvrir notre bande-annonce et à essayer la démo jouable lors du Bordeaux Game Festival. Restez à l'écoute pour plus de détails à venir !"},{id:2,title:"Partenariat avec Bordeaux Games Dev School - BGDS - pour former les talents de demain",date:"29 Novembre 2024",img:VC,text:"Dans notre engagement à soutenir la prochaine génération de développeurs de jeux, nous sommes fiers d'annoncer notre partenariat avec l'école Games Dev School - BGDS - à Bordeaux. Ce partenariat permettra aux étudiants de participer à des ateliers pratiques et à des stages au sein de notre studio. Nous croyons fermement que l'échange de connaissances et l'innovation sont essentiels pour l'avenir de l'industrie du jeu vidéo."},{id:3,title:"Une mise à jour majeure pour Baldur's Gate 3 arrive !",date:"28 Novembre 2024",img:UC,text:"Nous avons le plaisir de vous informer qu'une mise à jour majeure pour notre jeu à succès, Baldur's Gates 3, sera disponible le 23 Décembre 2024. Cette mise à jour apportera de nouvelles fonctionnalités, des personnages inédits et des améliorations graphiques pour enrichir votre expérience de jeu. Ne manquez pas nos événements en jeu pour célébrer cette nouvelle version et partager vos retours avec nous !"},{id:4,title:"Rejoignez-nous au Bordeaux Geek Festival !",date:"27 Novembre 2024",img:HC,text:"Nous sommes ravis de vous annoncer que Reubot Studio sera présent au Bordeaux Geek Festival, qui se déroulera à Bordeaux du 19 au 21 Mai 2025. Venez découvrir nos projets en cours, participer à des sessions de jeu en direct et rencontrer notre équipe de développeurs. C'est une occasion idéale pour nous de recueillir vos impressions et de partager notre passion pour le développement de jeux vidéo. Nous avons hâte de vous y retrouver !"}];function qC(){return h.jsx(h.Fragment,{children:h.jsx("ul",{children:WC.map(e=>h.jsx("li",{children:h.jsxs("article",{children:[h.jsxs(qt,{className:"row-article",children:[h.jsx(Me,{xs:4,md:3,children:h.jsx("img",{src:e.img,alt:""})}),h.jsxs(Me,{xs:8,md:9,children:[h.jsxs("span",{className:"published-text",children:["Article publié le ",e.date]}),h.jsx("h2",{children:e.title}),h.jsx("p",{children:e.text})]})]}),h.jsx("hr",{})]})},e.id))})})}function YC(){return h.jsx(h.Fragment,{children:h.jsxs(BC,{children:[h.jsx("br",{}),h.jsx("h1",{children:"Nos Actualités"}),h.jsx(qC,{})]})})}const KC="/Reubot-Studio/assets/team8-DJvSEZkb.jpg",QC="/Reubot-Studio/assets/team9-BTmJoy-1.jpg",XC="/Reubot-Studio/assets/studio-bVBKUdUG.jpg",JC="/Reubot-Studio/assets/location-uF4Vi1iK.png",ZC=ct.div`
